import styled from 'styled-components';
import { useNavigate, useLocation } from 'react-router-dom';
import { useUser } from './UserContext';
import logo from '../img/Logo.jpeg';

const HeaderPages = styled.header`
    background-color: #A8B8FF;
    display: flex;
    flex-direction: column;
    height: auto;
    margin-top: -30px;
    margin-left: -30px;
    margin-right: -30px;
    border-radius: 0 0 15px 15px;
`;

const IconUserName = styled.div`
    display: flex;
    flex-direction: row;
    height: fit-content;
    width: fit-content;
    gap: 10px;

    a {
        margin: auto;
        margin-left: 5px;
    }
`;

const NameUserShow = styled.p`
    color: white;
    height: fit-content;
    width: fit-content;

    &:hover {
        color: black;
        text-decoration: underline;
        cursor: pointer;        
    }
`;

const LogoList = styled.div`
    display: flex;
    flex-direction: row;
    padding: auto;
`;

const LogoPages = styled.img`
    margin: 16px;
    width: 100px;
    height: 100px;
    border-radius: 50%;

    &:hover{
        cursor: pointer;
    }
`;

const ListPages = styled.div`
    width: 90%;

    ul {
        list-style: none;
        display: flex;
        gap: 15px;
        padding: 0;
        margin: 40px auto;
    }

    li {
        width: 100%;
        height: auto;
        margin: auto;
        padding: 12px;
        border: 2px solid black;
        border-radius: 5px;
        background-color: #001a9075;

        &:hover {
            background-color: #5271FF;
            box-shadow: 0 0 2px 2px #001a90;
        }
    }
`;

const ActualPage = styled.li`
    background-color: #5271FF !important;
    font-weight: bold;
    box-shadow: 1px 5px 2px 2px #000000;
`;

const ButtonPage = styled.button`
    color: white;
    cursor: default
    border: 5px solid black;

    &:hover {
        box-shadow: 1px 5px 2px 2px #000000;
    }
`;

const ButtonActPage = styled.button`    
    color: white;

    &:hover {
    color: black;
    font-weight: bold;
    cursor: pointer;
    }    
`;

function Header() {
    const navigate = useNavigate();
    const { user, setUser } = useUser();
    const location = useLocation();

    const handleNavegation = (ruta) => {
        navigate(ruta);
    }

    const handleLogout = (e) => {
        e.preventDefault();
        setUser(null);
        navigate('/');
    }

    return (<>
        <HeaderPages>
            <IconUserName>
                <a href="https://wa.me/573212300716" target="_blank" rel="noopener noreferrer">
                    <i className="fa-solid fa-circle-question fa-2x question_icon" style={{color: "black", cursor: "help"}}></i>
                </a>
                <NameUserShow onClick={user? handleLogout : ()=> navigate('/')}>
                    {user ? `${user.nombre_usuario} (Cerrar sesión)` : 'Invitado (Ingresar)'}
                </NameUserShow>
            </IconUserName>
            <LogoList>
                <LogoPages onClick={() => handleNavegation ('/Inicio')} src={logo} alt="Logo ALF"/>
                <ListPages>
                    <ul>
                        <>
                            {location.pathname !== '/Servicios' ? (<li><ButtonPage onClick={() => handleNavegation('/Servicios')}>Agenda</ButtonPage></li>) : (<ActualPage><ButtonActPage>Agenda</ButtonActPage></ActualPage>)}
                            {location.pathname !== '/Empleados' ? (<li><ButtonPage onClick={() => handleNavegation('/Empleados')}>Empleados</ButtonPage></li>) : (<ActualPage><ButtonActPage>Empleados</ButtonActPage></ActualPage>)}
                            {location.pathname !== '/Equipos' ? (<li><ButtonPage onClick={() => handleNavegation('/Equipos')}>Equipos</ButtonPage></li>) : (<ActualPage><ButtonActPage>Equipos</ButtonActPage></ActualPage>)}
                            {location.pathname !== '/Clientes' ? (<li><ButtonPage onClick={() => handleNavegation('/Clientes')}>Clientes</ButtonPage></li>) : (<ActualPage><ButtonActPage>Clientes</ButtonActPage></ActualPage>)}
                            {location.pathname !== '/Tipos' ? (<li><ButtonPage onClick={() => handleNavegation('/Tipos')}>Tipos</ButtonPage></li>) : (<ActualPage><ButtonActPage>Tipos</ButtonActPage></ActualPage>)}
                        </>                       
                    </ul>
                </ListPages>
            </LogoList>
        </HeaderPages>
    </>);
}

export default Header;
